import KeeperFoto from "../images/KeeperAppTest.png";

const projectsEntry = [
    {
        key:1,
        title:"Website",
        components:"React, CSS, Bootstrap, HTML",
        text:"This Website",
        img: {KeeperFoto}
    },
    {
        key:2,
        title:"Keeper App",
        components:"React, CSS, HTML",
        text:"I dont know what is is tbh",
        img: null
    },
    {
        key:3,
        title:"ToDo List",
        components:"HTML, CSS, NodeJS, Express",
        text:"A nice little todo list for everyday use",
        img:null
    }
]

export default projectsEntry;
